import { Box, Typography } from '@material-ui/core';
import { FormikHelpers, Formik } from 'formik';
import React from 'react';
import { ModelOTP } from './model';

const OTP = () => {


    return (
        <Box >
            <Box textAlign="left" padding="20px">
                <Typography variant="h4" component="h4" >DayOne</Typography>
            </Box>
            <Box>
                <Typography variant="h4" component="h4" >Let's get started!</Typography>
            </Box>
            <Box>
                <Formik
                    initialValues={{
                        country: 1,
                        phone: ''
                    }}
                    onSubmit={(
                        values: ModelOTP,
                        { setSubmitting }: FormikHelpers<ModelOTP>
                    ) => {
                        setTimeout(() => {
                            alert(JSON.stringify(values, null, 2));
                            setSubmitting(false);
                        }, 500);
                    }}
                >
                 
                </Formik>
            </Box>

        </Box >
    )
}

export default OTP;
